import React, { useState } from 'react'
import axios from 'axios';
import Cookie from 'universal-cookie';
import Swal from 'sweetalert2'



const CreateNewUser = () => {
    function Branch(e){
        setBranch(e.currentTarget.value)
      }

    const cookie = new Cookie()
  const token = cookie.get('bearer')

  const [firstName , setfirstName] = useState('')
  const [lastName , setlastName] = useState('')
  const [branch , setBranch] = useState('edlib')
  const [address , setaddress] = useState('')
  const [ID_number , setID_number] = useState('')
  const [gender , setgender] = useState('ذكر')
  const [phone , setphone] = useState('')
  const [email , setemail] = useState('')
  const [role , setrole] = useState('user')
  const [password , setpassword] = useState('')
  const [loading , setLoading] = useState(false)
  const[barnchdata,setbarnchdata]=useState([])

    useEffect(()=>{
        axios.get('http://127.0.0.1:8000/api/branches',{
            headers:{
                Authorization: 'Bearer '+token
            }
        }).then(res => setbarnchdata(res.data.data))
        //eslint-disable-next-line react-hooks/exhaustive-deps
    },[])




    async function Submit(e) { 
        let Flage=true
        e.preventDefault();
    
        setLoading(true);
        if (firstname===''||lastname===''||branch===''||ID_number<=10 ) {
            Flage=false
        }
        else{
            Flage=true;
        }
        if(Flage){
    
    try{
      let res = await axios.post('http://127.0.0.1:8000/api/user/createUser',
      {
        branchaddress:branch,
        firstName:firstName,
        lastName:lastName,
        gender:gender,
        ID_number:ID_number,
        address:address,
        email:email,
        phone:phone,
        role:role,
        password:password
    
      },{
       headers:{
         Authorization : 'Bearer ' + token
       }
     }
      )
      .then((response)=>console.log(response));
    
    
      setLoading(false)
      await Swal.fire({
        position: 'center',
        icon: 'success',
        title: 'تم إجراء المناقلة  بنجاح',
        showConfirmButton: false,
        timer: 1500
      })
    } catch(err){
      setLoading(false)
      Swal.fire({
        icon: 'error',
        title: 'حدث خطأ ما',
        text: 'تعذر إضافة الموظف',
      })
      console.log(err)
    }
       
        }
        
    }
    

  return (
    <div>CreateNewUser</div>
  )
}

export default CreateNewUser
